    <style>
        * {

            background-color: #ff0000;

            padding: 15px 30px;

            border: none;

            margin-bottom: 30px;

            font-weight: bold;
        }
        
        .cta-button {
            animation: balancar 1s ease infinite;
        }

        }
        
        .beneficios ul {
            list-style-type: none;
        }
        
        .beneficios li {
            margin-bottom: 10px;
            padding-left: 25px;
            position: relative;
        }
        
        .beneficios li:before {

            }
